import React from 'react';

function Payment({friend,cost,reason,handleDeletePayment}) {
    return (
      <p>{friend} paid {cost} for {reason}</p>
    )
  }
function ListPayment({listPayment}) {
  return (
      <>
          {listPayment.map((payment, index)=> {
              return <Payment friend={payment.friend} cost={payment.cost} reason={payment.reason} key={index} />
          })}
      </>
)};



export default ListPayment;
